import { useState, useEffect } from "react/cjs/react.development";
// import TableRows from "./TableRowsUsers";

export default function UserStatus() {
  // const [rowsData, setRowsData] = useState([]);

  // const addTableRows = () => {
  //   const rowsInput = {
  //     emailAddress: "",
  //     password: "",
  //   };
  //   setRowsData([...rowsData, rowsInput]);
  // };
  // const deleteTableRows = (index) => {
  //   const rows = [...rowsData];
  //   rows.splice(index, 1);
  //   setRowsData(rows);
  // };

  // const handleChange = (index, evnt) => {
  //   const { name, value } = evnt.target;
  //   const rowsInput = [...rowsData];
  //   rowsInput[index][name] = value;
  //   setRowsData(rowsInput);
  // };
  const [category, setCategory] = useState([]);

  useEffect(() => {
    const getcategory = async () => {
      const res = await fetch("http://localhost/devopsdeveloper/category");
      const getdata = await res.json();
      setCategory(getdata);
      // console.log(getdata);
    };

    getcategory();
  }, []);

  return (
    <div>
      <table class="styled-table">
        <thead>
          <tr>
            <th>#</th>
            <th>Email</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {category.map((getcate) => (
            <tr key={getcate.category_id}>
              <td>{getcate.category_title}</td>
              <td> {getcate.category_heading}</td>
              <td> {getcate.category_status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
